import React , {useState} from 'react';





const Local=()=>{

    const[init,upda]=useState();
    const[subinit,subupda]=useState([]);


    const change=(e)=>{
       upda(e.target.value);
        }



    const sub=()=>{
        subupda(init);
        
    var oldData=localStorage.getItem('data');
        

    }

    
    localStorage.setItem('data',oldData);




    return(
        <>
        <h1>Local</h1>      
        <input type="text" onChange={change}></input>
        <button onClick={sub}>Submit</button>
        </>
    );
}

export default Local;
